    price: 12.99,
 },
 {
    id: 'm4',
    name: 'Schnitzel',
    descripiton: 'A german specialty!',
    price: 23.9,
 },

];
const AvailableMeals = () => {
    const items= DUMMY_MEALS.map((item)=>{<li>{item.name}</li>});
